import React from "react";
import styled from "styled-components";
import logo from "../assets/logo.png"

const StyledHeader = styled.header``;

function Header() {
  return (
    <StyledHeader>
      <div className="">
        <figure>
            <img src={logo} alt="" />
        </figure>
      </div>
    </StyledHeader>
  );
}

export default Header;
